import React from 'react'
import { Button } from 'react-bootstrap';

const WeatherButton = () => {
  return (
    <div className="weather-button">
      <Button onClick={weatherButton} variant="warning">현재 위치</Button>
      <Button onClick={weatherButton} variant="warning">토론토</Button>
      <Button onClick={weatherButton} variant="warning">캘거리</Button>
      <Button onClick={weatherButton} variant="warning">몬트리올</Button>
      <Button onClick={weatherButton} variant="warning">퀘백</Button>
    </div>
  )
}

export default WeatherButton
